import React from 'react';
import "./User.css";
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Button, Container } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  }));

const User = props => {
    const classes = useStyles();
    const usersData = props.items;
    let count = 1;
    const artistData = usersData.map((artist) =>
    <div className={classes.root}>
    <Grid container spacing={3} className="grid"
        direction="row"
        justify="space-between"
        alignItems="center">
      <Grid item xs={3}
        className="artist-info"
        direction="column"
        justify="space-between"
        alignItems="flex-start">
        <Grid item xs={3}>
            <Typography variant="h4">#{count++}</Typography>
        </Grid>
        <Grid item xs={3}>
            <Typography variant="h4" className="artistName">{artist.name}</Typography>
        </Grid>
      </Grid>
      <Grid item xs={6}>
      <a href={artist.external_urls.spotify} target="_blank" rel="noopener noreferrer">
                        <img src={artist.images[0].url} alt="artist" className="image"/>
                    </a>
      </Grid>
    </Grid>
  </div>
    ) 
    return (
        <Container>
            <div className="s">
                 <button onClick={() => props.handleClick("artists")}> click for artists</button>
                <h1>Your Top 10 Favorite Artist</h1>
                {artistData}
            </div>
        </Container>
        )
}
export default User;
